import React from 'react'

const Sobre = () => {
    return (
        <div> 
            <h1 className='py-4 px-4 rounded bg-pink-800 font-bold shadow-xl text-center mx-auto text-white'>Previna-se contra a covi-19!</h1>
            <h1 className='py-4 px-4 rounded bg-pink-800 font-bold shadow-xl text-center mx-auto text-white'>Aqui você encontra os status de pessoas próximas a você!</h1>
            <h1 className='py-4 px-4 rounded bg-pink-800 font-bold shadow-xl text-center mx-auto text-white'>Compartilhe o seu status diário para visualizar os demais status próximos a você!</h1>
        </div>)
}
export default Sobre
